import base64
from PIL import Image

#Imagen en base64
img_data = '    '


#funcion para mostrar la foto que esta guardada en base64
def showPicture():
    fh = open("imageToSave.png", "wb")
    fh.write(base64.b64encode(bytes(img_data, 'utf-8')))
    fh.close()
    with open("imageToSave.png", "wb") as fh:
     fh.write(base64.b64decode(bytes(img_data, 'utf-8')))
    im = Image.open("imageToSave.png")

#esta funcion sirve para ocultar la imagen pero si se activa e importa su libreria lo detecta el windows defender y lo borra
#win32api.SetFileAttributes("imageToSave.png",win32con.FILE_ATTRIBUTE_HIDDEN)
#show image
    im.show()